a Neue&quot;, sans-serif; font-size: 13px; text-align: center;\"><br style=\"outline: none;\"><strong style=\"outline: none; font-weight: bold;\">구찌 품질보증기준</strong><br style=\"outline: none;\">구찌 A/S 보증기간 2년<br style=\"outline: none;\">(상품 이상 시 무상수선, 고객의 부주의로 판단되는 경우 유상수선)<br style=\"outline: none;\">AS문의: 구찌코리아 고객상담센터 (1577-1921)<br style=\"outline: none;\"><br style=\"outline: none;\">&nbsp;</p><hr style=\"outline: none; margin-top: 5px; margin-bottom: 15px; border-top-color: rgb(205, 205, 205); color: rgb(68, 68, 68); font-family: &quot;Galano Grotesque&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 13px; text-align: center;\"><p style=\"outline: none; margin-bottom: 7.5px; color: rgb(68, 68, 68); font-family: &quot;Galano Grotesque&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 13px; text-align: center;\">&nbsp;</p><p style=\"outline: none; margin-bottom: 7.5px; color: rgb(68, 68, 68); font-family: &quot;Galano Grotesque&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 13px; text-align: center;\"><br style=\"outline: none;\">&nbsp;</p><p style=\"outline: none; margin-bottom: 7.5px; color: rgb(68, 68, 68); font-family: &quot;Galano Grotesque&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 13px; text-align: center;\"><strong style=\"outline: none; font-weight: bold;\">DETAIL</strong>&nbsp; POINT VIEW</p><p style=\"outline: none; margin-bottom: 7.5px; color: rgb(68, 68, 68); font-family: &quot;Galano Grotesque&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 13px; text-align: center;\">&nbsp;</p><p style=\"outline: none; margin-bottom: 7.5px; color: rgb(68, 68, 68); font-family: &quot;Galano Grotesque&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 13px; text-align: center;\">&nbsp;</p><p style=\"outline: none; margin-bottom: 7.5px; color: rgb(68, 68, 68); font-family: &quot;Galano Grotesque&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 13px; text-align: center;\"><img alt=\"\" src=\"https://s3.ap-northeast-2.amazonaws.com/trenbe-tmp/1000/1574154390723-4c82f0df-9e43-4768-b5a6-ee574c4cad1b.jpg\" style=\"outline: none; border: 0px; max-width: 100%; margin-top: 1rem; height: auto !important;\"></p><p style=\"outline: none; margin-bottom: 7.5px; color: rgb(68, 68, 68); font-family: &quot;Galano Grotesque&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 13px; text-align: center;\"><br style=\"outline: none;\">&nbsp;</p><h2 style=\"outline: none; font-family: &quot;Galano Grotesque&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Helvetica Neue&quot;, sans-serif; line-height: 1.1; color: rgb(68, 68, 68); font-size: 15px; text-align: center;\">01.<br style=\"outline: none;\"><strong style=\"outline: none; font-weight: bold;\"><u style=\"outline: none;\">\'변하지 않는건 클래식. 로고 금장 장식\'</u></strong></h2><p style=\"outline: none; margin-bottom: 7.5px; color: rgb(68, 68, 68); font-family: &quot;Galano Grotesque&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 13px; text-align: center;\">큰 사이즈의 금장장식은 클래식을 넘어 트렌디한 멋을 자아낸다.<br style=\"outline: none;\">일상생활을 함께하며 사용감이 묻어나는 금장장식은<br style=\"outline: none;\">세월이 흐를수록 지갑의 가치를 더한다.<br style=\"outline: none;\"><br style=\"outline: none;\"><br style=\"outline: none;\">&nbsp;</p><p style=\"outline: none; margin-bottom: 7.5px; color: rgb(68, 68, 68); font-family: &quot;Galano Grotesque&quot;, &quot;Apple SD Gothic Neo&quot;, &quot;Noto Sans KR&quot;, &quot;Helvetica Neue&q